  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:54.290781\",\n\t\"name\": \"contaminants-in-striped-bass-from-the-flint-and-apalachicola-rivers-1986-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Five striped bass (Morone saxitilis), collected
  between April 1986 and May 1989 from the Flint River at Albany, Georgia, and the
  Apalachicola River at Chattahoochee, Florida, were analyzed for chemical contamination.
  All fish were incidental mortalities associated with the Fish and Wildlife Service's
  induced spawning and restoration program at the Welaka National Fish Hatchery, Florida.
  The fish, all female, varied in total length from 908 to 1070 mm and weight from
  10.68 to 17.27 kg. Individual fish tissues consisting of unfertilized eggs, mesentery
  fat, muscle, and liver were analyzed. Analytical results showed elevated levels
  of metals, polycyclic aromatic hydrocarbons (PAH), organochlorine pesticides, polychlorinated
  biphenyls (PCBs) and aliphatic hydrocarbons in specific tissues of individual fish.
  The presence of particular contaminants in striped bass may contribute to impaired
  reproductive capacity. Contaminants of primary concern are toxaphene, DDT metabolites,
  PCBs and mercury. Because of the small number of striped bass evaluated in this
  project, a more detailed study is required to better define contaminant threats
  to striped bass.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
